    <style>
        .swiper-container{
            width: 100%;
            height: 200px;
            margin: auto;
            margin-top: 200px;
            /* position: relative; */
            overflow: hidden;
            /* overflow-y:hidden; */
            /* overflow-x: scroll; */
            -webkit-overflow-scrolling: none;
            /* background-color: #a8762ad8; */
        }
        .swiper-box{
            /* width: 630px; */
            width: 540px;
            height: 120px;
            /* display: flex;
            flex-flow: row nowrap;
            justify-content: flex-start;
            align-items: flex-start; */
            /* position: relative;
            overflow: scroll; */
            position: relative;
            margin-top: 40px;
            /* padding-left: 65px;
            padding-right: 65px; */
            left:110px;
            /* background-color: #6e1d1da2; */
            -webkit-overflow-scrolling: none;
            /* transition:left 1s ease-in-out; */
            /* left: 0; */
            /* margin-left: -160px; */
            /* transform: translateX(0); */
        }
        .swiper-container::-webkit-scrollbar{
            display: none;
        }
        .swiper-box::-webkit-scrollbar{
            display: none;
        }
        .banner-box{
            width: 180px;
            height: 120px;
            /* margin-right: 30px; */
            float: left;
            /* background-color: #c1b61ba5; */
        }
        .banner-content{
            width: 100%;
            height: 100%;
            transform: scale(0.7);
            opacity:0.5;
            /* transition: all 1s ease-in-out; */
        }
        .show-banner{
            transform: scale(1) !important;
            opacity: 1 !important;
        }
        .banner-content{
            width: 100%;
            height: 100%;
            border-radius: 8px;
        }
    </style>
</head>

    <script>
        let swiperElement=document.querySelector('.swiper-container')
        let swiperBox=document.getElementById('swiper-box')
        let bannerBoxs=document.querySelectorAll('.banner-content')
        let startX=''
        let current=0
        function transCss(elem,vi) {
            let vis=vi>0.5?1:vi<0?0.5:(vi+0.5)
            elem.style.transform='scale('+vis+')'
            elem.style.opacity=vis+''
        }
        transCss(bannerBoxs[0],0.5)
        swiperElement.addEventListener('touchstart',function(e){
                console.log('touchstart====',current);
                startX=e.touches[0].clientX
            },false)
        swiperElement.addEventListener('touchmove',function(e){
                let vi=Math.abs(e.touches[0].clientX-startX)/180*0.5
                swiperBox.style.left=-180*current+110+e.touches[0].clientX-startX+'px'
                if (e.touches[0].clientX-startX>0) {
                    if (current>0) {
                        transCss(bannerBoxs[current-1],vi)
                    }
                    if (current!=0) {
                        transCss(bannerBoxs[current],0.5-vi)
                    }
                    
                }else{
                    if (current<bannerBoxs.length-1) {
                        transCss(bannerBoxs[current+1],vi)
                    }
                    if (current!=bannerBoxs.length-1) {
                        transCss(bannerBoxs[current],0.5-vi)
                    }
                }

            },false)
        swiperElement.addEventListener('touchend',function(e){
            let ms=Math.abs(e.changedTouches[0].clientX-startX)
            let mdr=e.changedTouches[0].clientX-startX>0
            if (ms>50) {
                current=current+(mdr?-1:1)
            }
            current=current<0?0:current<bannerBoxs.length-1?current:bannerBoxs.length-1
            console.log('ms',ms);
            console.log('mdr',mdr?'right':'left');
            console.log('current',180*current);
            swiperBox.style.left=-180*current+110+'px'
            for (let index = 0; index < bannerBoxs.length; index++) {
                if (current==index) {
                    transCss(bannerBoxs[index],0.5)
                } else {
                    transCss(bannerBoxs[index],0)
                }
                
            }
            startX=0
            },false)
    </script>
